<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>JBolt Home</title>
<style type="text/css">
@charset "UTF-8";
html {
  line-height: 1.15; /* 1 */
  -ms-text-size-adjust: 100%; /* 2 */
  -webkit-text-size-adjust: 100%; /* 2 */
  background: #fffcf4;
  max-height: 100%;
  max-width:100%;
  width:100%;
  min-height:100%;
  padding: 0px;
  overflow: auto;
}
body {
  margin: 0;
  background: #fffcf4;
    max-height: 100%;
  max-width:100%;
  width:100%;
  height:100%;
  padding: 0px;
  overflow: hidden;
}

 
article,
aside,
footer,
header,
nav,
section {
  display: block;
}
 
h1 {
  font-size: 2em;
  margin: 0.67em 0;
}
 
figcaption,
figure,
main { /* 1 */
  display: block;
}
 
figure {
  margin: 1em 40px;
}
 
hr {
  box-sizing: content-box; /* 1 */
  height: 0; /* 1 */
  overflow: visible; /* 2 */
}
 

pre {
  font-family: monospace, monospace; /* 1 */
  font-size: 1em; /* 2 */
}
 

a {
  background-color: transparent; /* 1 */
  -webkit-text-decoration-skip: objects; /* 2 */
}

b,
strong {
  font-weight: inherit;
}
 

b,
strong {
  font-weight: bolder;
}

 
img {
  border-style: none;
}
 
svg:not(:root) {
  overflow: hidden;
}


button,
input,
optgroup,
select,
textarea {
  font-family: sans-serif; /* 1 */
  font-size: 100%; /* 1 */
  line-height: 1.15; /* 1 */
  margin: 0; /* 2 */
}

button,
input { /* 1 */
  overflow: visible;
}


button,
select { /* 1 */
  text-transform: none;
}

button,
html [type="button"], /* 1 */
[type="reset"],
[type="submit"] {
  -webkit-appearance: button; /* 2 */
}

button::-moz-focus-inner,
[type="button"]::-moz-focus-inner,
[type="reset"]::-moz-focus-inner,
[type="submit"]::-moz-focus-inner {
  border-style: none;
  padding: 0;
}
button:-moz-focusring,
[type="button"]:-moz-focusring,
[type="reset"]:-moz-focusring,
[type="submit"]:-moz-focusring {
  outline: 1px dotted ButtonText;
}

fieldset {
  padding: 0.35em 0.75em 0.625em;
}

legend {
  box-sizing: border-box; /* 1 */
  color: inherit; /* 2 */
  display: table; /* 1 */
  max-width: 100%; /* 1 */
  padding: 0; /* 3 */
  white-space: normal; /* 1 */
}
textarea {
  overflow: auto;
}
template {
  display: none;
}
[hidden] {
  display: none;
}
.logo{
display: block;
margin: 10px auto 30px auto;
text-align: center;
}
.logo_bottom{
	font-size:24px;
	color:#333;
	text-align: center;
	display: block;
	margin: 0px auto;
}

img{
	display: inline-block;
}
.j_box{
	clear: both;
    margin-bottom: 15px;
    margin-top: 15px;
    padding: 0;
}

.j_box.j_box_success{
	border: 1px solid #5cb85c;
	border-top: 4px solid #5cb85c;
}
.j_box.j_box_info{
	border: 1px solid  #5bc0de;
	border-top: 4px solid  #5bc0de;
}
.j_box.j_box_danger{
	border: 1px solid  #d9534f;
	border-top: 4px solid  #d9534f;
}
.j_box.j_box_warn{
	border: 1px solid  #f0ad4e;
	border-top: 4px solid  #f0ad4e;
}
.j_box.j_box_primary{
	border: 1px solid  #337ab7;
	border-top: 4px solid  #337ab7;
}
.j_box.j_box_default{
	border: 1px solid   #e7eaec;
	border-top: 4px solid   #e7eaec;
}

.j_box .j_box_title{
    background: #fff;
    border-bottom:1px solid  #e7eaec;
    margin-bottom: 0;
    padding: 5px 15px;
    min-height: 30px;
}
.j_box .j_box_title>i.fa{
	font-size: 16px;
}
.j_box .j_box_title .j_box_title_opt{
	float: right;
	height: 100%;
	line-height:2;
}
.j_box .j_box_title .j_box_title_opt>i.fa{
	cursor: pointer;
}
.j_box .j_box_title .j_box_title_opt>i.fa:hover{
	color:#5cb85c;
}

.j_box .j_box_title h3{
	display: inline-block;
    font-size: 16px;
    padding: 0;
    margin: 5px;
}
.j_box .j_box_content{
	background: #FFF;
    color: inherit;
    padding: 5px;
    border-color: #e7eaec;
}
.j_box .j_box_title.j_no_border{
	 border-bottom:none;
}
.j_box.j_box_list .j_box_content{
	padding: 0px 15px 15px 15px;
}
.j_box.j_box_jsplist .j_box_content{
	padding: 15px 15px 15px 15px;
}
ul.footerUL{
	list-style: none;
	padding-left:15px;
	margin: auto;
}
ul li{
display:block;
list-style: none;
padding: 3px 0px;
margin: 5px 0px;
}
ul.footerUL li{
display:inline-block;
list-style: none;
padding: 3px 0px;
margin: 0px 10px;
}
.version{
	display: inline-block;
	font-size:20px;
	color:#333;
}
.bottom{
	margin: 60px auto;
	width:800px;
}
ul.footerUL li a{text-decoration: underline;font-size:18px;font-weight: 400;}
ul.footerUL li a:not(.last):after{
content: '|';
margin-left: 20px;
text-decoration: none;
font-weight: bold;
font-size:14px;
}
a:hover{
text-decoration: underline;
color:red;
}
.j_text_primary{
color:#337ab7;
}
.j_text{
color:#555;
}
.jbolt_btns{
	margin: auto;
	text-align: center;
}
.jbolt_btns .jboltbtn{
	display:inline-block;
	margin: 10px;
}
.jbolt_btns .jboltbtn{
	display:inline-block;
	width: 180px;
	height: 150px;
	cursor: pointer;
	text-align: center;
	position: relative;
}
